function fillVerifyIdentity() {
  $("[data-applicant-index]:not(.filled)").toArray().forEach(function (e) {
    fillItem($(e));
  });
  $(".add-another").click();
  setTimeout(function () {
    $("[data-applicant-index]:not(.filled)").toArray().forEach(function (e) {
      fillItem($(e));
    });
    MaterialUtils.updateTextFields("#verify-identity-form");
  });

  function fillItem($container) {
    $container.addClass("filled");
    $("[name$='IdentificationType']:first", $container).parent().click();
    $(".jurisdiction", $container).data("mdl-select").setValue("QC");
    $(".issue-date.wrapper-month .mdl-select", $container).data("mdl-select").setValue(1);
    $(".issue-date.wrapper-day .mdl-select", $container).data("mdl-select").setValue(20);
    $(".issue-date.wrapper-year .mdl-select", $container).data("mdl-select").setValue(2005);
    $(".expiry-date.wrapper-month .mdl-select", $container).data("mdl-select").setValue(1);
    $(".expiry-date.wrapper-day .mdl-select", $container).data("mdl-select").setValue(20);
    $(".expiry-date.wrapper-year .mdl-select", $container).data("mdl-select").setValue(2025);
    $("[name$='Number']", $container).val("123456789").trigger("change");
    var $upload = $(".upload-container", $container);

    if ($upload.length > 0) {
      $("img:first", $upload).click();
    }
  }
}

function fillAssets() {
  $('.assets-container:first button').click();
  $('input[name="Certified"]').parent().click();
  setTimeout(function () {
    return fillOwnedPropertyAsset($('[data-owned-property-asset-index="0"]'));
  });

  function fillOwnedPropertyAsset($container) {
    $("input[name$='HasBeingSoldToFinanceNewPurchase'][value='False']", $container).parent().click();
    $("input[name$='HasBeingRenewed'][value='True']", $container).parent().click();
    $("input[name$='IsJointlyOwned'][value='True']", $container).parent().click();
    $("input[name$='Occupancy'][value='OwnerOccupied']", $container).parent().click();
    $("input[name$='PropertyType'][value='Condominium']", $container).parent().click();
    $("input[name$='MarketValue']", $container).val(100000);
    $("input[name$='CondoFees']", $container).val(100);
    $("input[name$='HeatingCosts']", $container).val(100);
    $("input[name$='MortgageOnProperty'][value='True']", $container).parent().click();
    $("input[name$='CurrentBalance']", $container).val(20000);
    $("input[name$='PaymentAmount']", $container).val(500);
    $("input[name$='PaymentFrequency'][value='Monthly']", $container).parent().click();
    $("input[name$='FinancialInstitution']", $container).val("Great Financial Institution");
    $("input[name$='PaymentIncludeTaxes'][value='True']", $container).parent().click();
    MaterialUtils.updateTextFields($container);
    setTimeout(function () {
      $(".add-asset-button-container button", $container).click();
    });
  }
}

function fillLiabilities() {
  var $createButton = $('button[value="Create-RevolvingCredit"]');

  if ($createButton.length === 1) {
    $('input[name="Certified"]').parent().click();
    $('button[value="Create-RevolvingCredit"]').click();
  } else {
    var $container = $('.liability-container:first');
    $("input[name$='Type']", $container).closest('.mdl-select').data("mdl-select").setValue("Mortgage");
    $("input[name$='CurrentBalance']", $container).val(20000);
    $("input[name$='AccountNumber']", $container).val(123456789);
    $("input[name$='CreditLimit']", $container).val(10000);
    $("input[name$='PaymentAmount']", $container).val(500);
    $("input[name$='DebtServiceValue']", $container).val(46);
    $("input[name$='PaymentFrequency'][value='Monthly']", $container).parent().click();
    MaterialUtils.updateTextFields($container);
    setTimeout(function () {
      $("button", $container).click();
    });
  }
}

function fillDocuments() {
  $(".document-group").toArray().slice(0, 2).forEach(function (e) {
    $("button", $(e)).click();
    setTimeout(function () {
      $(".upload-control img", $(e)).click();
      $("input.document-upload", $(e)).trigger("change");
    });
  });
}

function getRandomInt(min, max) {
  return Math.floor(Math.random() * (max - min)) + min;
